import React from 'react';

const users = [
    {
        name: "David",
       age: 24
    },
    {
        name: "Pedro",
        age: 28 
    },
    {
        name: "Maria",
        age: 26
    }
]

const Participantes = () => {
return(
 users.map(function (name, age) {
        {name} {age}
 })
);
}

export default Participantes;
